    display_txt: 'The Predictive Power Score (PPS) is used to estimate the ability
      of an image property (such as brightness)to predict the label by itself. (Read
      more about <a href=https://docs.deepchecks.com/stable/vision/auto_checks/train_test_validation/plot_feature_label_correlation_change.html
      target="_blank">Predictive Power Score</a>) <u>In the graph above</u>, we should
      suspect we have problems in our data if: 1. <b>Train dataset PPS values are
      high</b>:    A high PPS (close to 1) can mean that there''s a bias in the dataset,
      as a single property can predict   the label successfully, using simple classic
      ML algorithms 2. <b>Large difference between train and test PPS</b> (train PPS
      is larger):    An even more powerful indication of dataset bias, as an image
      property that was powerful in train    but not in test can be explained by bias
      in train that is not relevant to a new dataset. 3. <b>Large difference between
      test and train PPS</b> (test PPS is larger):    An anomalous value, could indicate
      drift in test dataset that caused a coincidental correlation to the target label.'
